import React from 'react'
import { Box, Card, Button, Container, Accordion, useTheme, makeStyles, Divider, AccordionSummary, Typography, AccordionDetails } from '@material-ui/core'
import { Line } from 'react-chartjs-2'
import 'date-fns';
import MomentUtils from '@date-io/moment';
import { KeyboardDatePicker, MuiPickersUtilsProvider } from "@material-ui/pickers";
import moment from 'moment';

  const useStyles = makeStyles((theme) => ({
    typoGraphy: {
        fontSize: '12px'
    },
}))
function Chart() {
    const [selectedDate, setSelectedDate] = React.useState(moment());
    const classes = useStyles()
    const labels = ['Jan', 'Feb', 'Mar', 'Apr', 'May', 'Jun', 'Jul', 'Aug']
    const data = {
        labels: labels,
        datasets: [
            {
                label: 'Type 1',
                borderColor: ['#2b79ff'],
                data: [0.65, 0.59, 0.80, 0.81, 0.56, 0.55, 0.40, 0.50, 0.70, 0.75, 0.80, 0.85],
            },
            {
                label: 'Type 2',
                borderColor: ['#ff2b2b'],
                data: [0.60, 0.67, 0.82, 0.70, 0.40, 0.30, 0.40, 0.50, 0.80, 0.85, 0.90, 0.90],
            },
            {
                label: 'Type 3',
                borderColor: ['#a72bff'],
                data: [0.30, 0.40, 0.50, 0.20, 0.40, 0.35, 0.35, 0.40, 0.50, 0.70, 0.75, 0.90],
            },
        ]
    };
    const handleDateChange = (date) => {
        setSelectedDate(date);
      };

    return (
        <div>
            <Card className="p-4">
                <div className="d-flex flex-row justify-content-between ">
                    <Typography>Analytics</Typography>
                    <div className="d-flex justify-content-center flex-row">
                    <div className="border border-gray rounded m-1">
                        
                                <MuiPickersUtilsProvider utils={MomentUtils}>
                    
                                <KeyboardDatePicker
                                    margin="normal"
                                    id="date-picker-dialog"
                                    format="MMMMDD, YYYY"
                                    // format={`${moment().format("DD/MM/YYYY")} - ${moment().add(3, 'month').format("DD/MM/YYYY")}`}
                                    value={selectedDate}
                                    onChange={handleDateChange}
                                    KeyboardButtonProps={{
                                        'aria-label': 'change date',
                                    }}
                                />
                                </MuiPickersUtilsProvider>
                           
                    </div>
                    <div className="d-flex justify-content-center flex-row border border-gray rounded m-1">
                    <div className="col-md-6 col-xxl-3 mb-0 pl-md-2">
                        <div>
                            <div className="py-2 px-2 d-flex align-items-center">
                                <div>
                                    <Typography className={classes.typoGraphy}><b>Heading1</b></Typography>
                                    <Typography className={classes.typoGraphy}>24,350</Typography>
                                </div>
                            </div>
                        </div>
                    </div>
                    <div className="col-md-6 col-xxl-3 mb-0 pl-md-2 ml-2">
                        <div >
                            <div className="py-2 px-2 d-flex align-items-center border-right border-gray">
                                <div>
                                    <Typography className={classes.typoGraphy}><b>Heading2</b></Typography>
                                    <Typography className={classes.typoGraphy}>12,360</Typography>
                                </div>
                            </div>
                        </div>
                    </div>
                    <div className="col-md-6 col-xxl-3 mb-0 pl-md-2">
                        <div>
                            <div className="py-2 px-2 d-flex align-items-center">
                                <div>
                                    <Typography className={classes.typoGraphy}><b>Heading3</b></Typography>
                                    <Typography className={classes.typoGraphy}>10,671</Typography>
                                </div>
                            </div>
                        </div>
                    </div>
                    <div className="col-md-6 col-xxl-3 mb-0 pl-md-2">
                        <div>
                            <div className="py-2 px-2 d-flex align-items-center">
                                <div>
                                    <Typography className={classes.typoGraphy}><b>Heading4</b></Typography>
                                    <Typography className={classes.typoGraphy}>6,562</Typography>
                                </div>
                            </div>
                        </div>
                    </div>
                    </div>
                    </div>

                </div>
            <Line className="mt-4" data={data} options={{ responsive: true, title: 'Thickness' }} />
        </Card>
        </div>
    )
}

export default Chart
